import React from 'react'
import {AppBar, Toolbar, IconButton, Tabs, Tab, Link} from '@material-ui/core'
import makeStyles from '@material-ui/core/styles/makeStyles'
import { GlobalContext } from '../ContextApi'
import Brightness3Icon from '@material-ui/icons/Brightness3';
import WbSunnyIcon from '@material-ui/icons/WbSunny';

const useStyles = makeStyles(theme => ({
  root: {
    borderBottom: '2px solid silver',
  }
}))


function Header() {
  const classes = useStyles()
  const {darkMode, setDarkMode} = GlobalContext()


  return (
    <AppBar position="sticky" className={classes.root} color="inherit">
      <Toolbar variant="dense" style={{display: 'flex'}}>
        <div style={{flexGrow: '1'}}> 
          <Tabs
            value={0}
          >
            <Tab label="home" />
            <Link href="#about"><Tab label="about" /></Link>
            <Link href="#contat"></Link>
            <Tab label="projects" />
            <Tab label="blog" />
            <Tab label="contacts" />
          </Tabs>
        </div>
        <div>
          <IconButton onClick={()=>setDarkMode(!darkMode)}>
            {darkMode ? <WbSunnyIcon/> : <Brightness3Icon />}
          </IconButton>
        </div>
      </Toolbar>
    </AppBar>
  )
}

export default Header
